('ChIJx8N_lBHGwoARUakiXk3MBQY', 'Mariachi Plaza', '. A little over a mile from downtown LA, where East First Street, Boyle and Pleasant Avenues come together, the Plaza is named for the mariachi musicians who have gathered here in their elegant charro suits since the 1930s, ready to be hired to play in restaurants, at private parties or community events.', '[\'point_of_interest\', \'establishment\']', 4.5, 913, '(323) 356-2219', 'http://mariachiplazalosangeles.com/site/', 4, '1831 1st St, Los Angeles, CA 90033, USA', 'None', 34.0474, -118.22),
('ChIJgQpEAUXGwoARoG9LzK0GhV0', 'El Pueblo de Los Angeles Historical Monument', 'El Pueblo de Los Angeles Historical Monument is near the site of the early Los Angeles pueblo or town where forty-four settlers of Native American, African and European heritage journeyed more than one-thousand miles across the desert from present-day northern Mexico and established a farming community in September 1781. Since that time, Los Angeles has been under the flags of Spain, Mexico, and the United States and has grown into one of the world’s largest metropolitan areas. ', '[\'point_of_interest\', \'establishment\']', 4.5, 1357, '(213) 485-6855', 'http://elpueblo.lacity.org/', 0, '125 Paseo De La Plaza, Los Angeles, CA 90012, USA', '[\'Monday: 8:00 AM – 10:00 PM\', \'Tuesday: 8:00 AM – 10:00 PM\', \'Wednesday: 8:00 AM – 10:00 PM\', \'Thursday: 8:00 AM – 10:00 PM\', \'Friday: 8:00 AM – 10:00 PM\', \'Saturday: 8:00 AM – 10:00 PM\', \'Sunday: 8:00 AM – 10:00 PM\'][\'Monday: 8:00 AM – 10:00 PM\', \'Tuesday: 8:00 AM – 10:00 PM\', \'Wednesday: 8:00 AM – 10:00 PM\', \'Thursday: 8:00 AM – 10:00 PM\', \'Friday: 8:00 AM – 10:00 PM\', \'Saturday: 8:00 AM – 10:00 PM\', \'Sunday: 8:00 AM – 10:00 PM\'][\'Monday: 8:00 AM – 10:00 PM\', \'Tuesday: 8:00 AM – 10:00 PM\', \'Wednesday: 8:00 AM – 10:00 PM\', \'Thursday: 8:00 AM – 10:00 PM\', \'Friday: 8:00 AM – 10:00 PM\', \'Saturday: 8:00 AM – 10:00 PM\', \'Sunday: 8:00 AM – 10:00 PM\'][\'Monday: 8:00 AM – 10:00 PM\', \'Tuesday: 8:00 AM – 10:00 PM\', \'Wednesday: 8:00 AM – 10:00 PM\', \'Thursday: 8:00 AM – 10:00 PM\', \'Friday: 8:00 AM – 10:00 PM\', \'Saturday: 8:00 AM – 10:00 PM\', \'Sunday: 8:00 AM – 10:00 PM\'][\'Monday: 8:00 AM – 10:00 PM\', \'Tuesday: 8:00 AM – 10:00 PM\', \'Wednesday: 8:00 AM – 10:00 PM\', \'Thursday: 8:00 AM – 10:00 PM\', \'Friday: 8:00 AM – 10:00 ', 34.0565, -118.239),
('ChIJWa5u50TGwoARxrEHn_jpCU0', 'Olvera Street', 'Olvera Street (also Calle Olvera or Placita Olvera, originally Calle de los Vignes, Vine Street, and Wine Street[1][2]) is a historic street in downtown Los Angeles, and a part of El Pueblo de Los Angeles Historic Monument, the area immediately around the 19th-century Los Angeles Plaza, which has been the main square of the city since the early 1820s, when California was still part of Mexico, and was the center of community life[3] until the town expanded in the 1870s. estaurants, vendors, and public establishments are along the pedestrian mall, a block-long narrow, tree-shaded, brick-lined marketplace where some merchants are descended from the original vendors who opened shops when a then-decrepit Olvera Street was recreated as a tourist attraction in 1930, a romanticized version with the theme of a Mexican marketplace.', '[\'route\']', 4.9, 879, 'None', 'None', 0, 'Olvera St, Los Angeles, CA 90012, USA', 'None', 34.0576, -118.238),
