('ChIJw5eequLDwoAR8Svhr64VpT4', 'Fiji Hill', 'Located on the campus of Occidental College(Oxy), Fiji Hill is a beloved student landmark that offers nice views of the Eagle Rock area. The easiest way to get here is to park for free at the very northeast corner of campus undeer the solar roof parking lot. PS If you have an EV you can charge it up while you go up mount fiji. It can get a bit slippery so be cautioua.', '[\'park\', \'point_of_interest\', \'establishment\']', 4.9, 12, '(310) 925-5075', 'None', 0, '4622 Townsend Ave, Los Angeles, CA 90041, USA', 'None', 34.1287, -118.206),
('ChIJoTIjJWbBwoARpljh1m4ytbc', 'Occidental College', 'Nestled in the hills of Los Angeles’ Eagle Rock community and replete with natural beauty, the Occidental campus is both peaceful and a place of palpable energy. There are many beautiful locations through the campus. Some notable places to walk around is the quad at the center of campus where trees provide shade for study, conversation, and contemplation. There is also the Sycamore Glen nearby. There are also many birds that visit this campus.', '[\'university\', \'point_of_interest\', \'establishment\']', 4.1, 112, '(323) 259-2500', 'http://www.oxy.edu/', 0, '1600 Campus Rd, Los Angeles, CA 90041, USA', 'None', 34.1274, -118.21),
